    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Waubay NWR for the next 15 years. This plan outlines
    the Complex vision and purpose and describes how Waubay NWR will contribute to the
    overall mission of the Refuge System. The plan provides an introduction to the Complex,
    an overview of the CCP process, a summary of Complex resources, information about
    the management direction, and strategies for implementation and monitoring. Key
    planning issues include: grassland restoration, wetland restoration, wildlife management,
    and public use.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
